VALUES ('8033247740653', 'Ecorce d\'orange confites', 'Candied orange 600/omin. (orange peel, glucose-fructose syru extrose, acidity regulator: citric acid E330, preservative: potassium sorbate E202, E220 SULFUR DIOXIDE (a due), extra dark chocolate 350/omin. (cocoa paste (58% min.) sugart cocoa butter, emulsifier: SOY lecithin, flavori Allergens: sulfur dioxide E220,soy. The product may contain traces of nuts. Store in a cool dryt place. KANDIERTE ORANGENSCHALEN MIT DUNKLER SCHOKOLADE ÜBERZOGEN Zutaten: Orangenschalen 600/omin. (Orangenschalen, Glukose-Fruktose-Sirup/ Zucker, Dextrose, Sduerungsmittel: Zitronensdure E330, Konservierungsstoff: Kaliumsorbat E202, E220 SCHWEFELDIOXID (als Rest), extra dunkle Schokolade 350/omin. (Kakaomasse (58% min.), Zucker, Kakaobutter, Emulgator: SOJALECITHIN, Aromastoffe), Allergene: Schwefeldioxid E220, Sojm Das Produkt kann Spuren von Nüssen. An einem kühlen, trockenen Ort aufbewahren. ECORCES D\'ORANGE CONFITES ENROBÉS DE CHOCOLAT NOIR Zutaten: Orange confite 600/omin. (écorces diorange, sirop de glucose-fructose, sucre, dextrose, régulateur d\'acidité: acide citrique E330, conservateur: sorbate de potassium E202, E220 DIOXYDE DE SOUFRE (comme résidu), chocolat extra noir 350/omin. (pâte de cacao (58% min.), sucre, beurre de cacao, émulsifiant: lécithine de SOJA, arômes), Allergènes: dioxyde de soufre E220, le soja. Le produit peut contenir des traces de noix.', 'https://static.openfoodfacts.org/images/products/803/324/774/0653/front_fr.4.400.jpg', '8.25', '0.02', '77.14', '69.11', '4.2', '1.54', '0.062', '0.0244094488188976', '', '0');

